"use strict";(self.webpackChunkwaste_of_space_wiki=self.webpackChunkwaste_of_space_wiki||[]).push([[2700],{4527:e=>{e.exports=JSON.parse('{"tag":{"label":"Electrical","permalink":"/Pilot.lua-Luau-LSP/tags/electrical","allTagsPath":"/Pilot.lua-Luau-LSP/tags","count":77,"items":[{"id":"objects/AirSupply","title":"AirSupply","description":"Generates a 300 stud radius oxygen bubble when powered on. Very important part for space ships, as it acts as the oxygen supply for the ship.","permalink":"/Pilot.lua-Luau-LSP/objects/AirSupply"},{"id":"objects/AlienCore","title":"AlienCore","description":"A mysterious piece of technology found within many robotic aliens.","permalink":"/Pilot.lua-Luau-LSP/objects/AlienCore"},{"id":"objects/Antenna","title":"Antenna","description":"A wireless transmitter that can transmit electricity from wires and trigger signals from trigger wires and buttons.","permalink":"/Pilot.lua-Luau-LSP/objects/Antenna"},{"id":"objects/ARController","title":"ARController","description":"Like a TouchScreen, but for your actual screen.","permalink":"/Pilot.lua-Luau-LSP/objects/ARController"},{"id":"objects/ARGlasses","title":"ARGlasses","description":"Like a handheld Microcontroller, with a TouchScreen for your actual screen.","permalink":"/Pilot.lua-Luau-LSP/objects/ARGlasses"},{"id":"objects/Assembler","title":"Assembler","description":"Assembles items as configured when the structure is supplied with the required power and resources.","permalink":"/Pilot.lua-Luau-LSP/objects/Assembler"},{"id":"objects/AutomaticLaser","title":"AutomaticLaser","description":"Fires a continous set of lasers when powered. Like most other energy/thermal weapons, it generates heat when powered. It generates up to 65 degrees of heat, meaning you will need atleast 2 or 3 coolers.","permalink":"/Pilot.lua-Luau-LSP/objects/AutomaticLaser"},{"id":"objects/Beacon","title":"Beacon","description":"Creates a small beacon of light when powered.","permalink":"/Pilot.lua-Luau-LSP/objects/Beacon"},{"id":"objects/Boombox","title":"Boombox","description":"Must be powered in order to play music. When clicked, it will toggle playing music and will play the song id you give it.","permalink":"/Pilot.lua-Luau-LSP/objects/Boombox"},{"id":"objects/BurnerGenerator","title":"BurnerGenerator","description":"Creates electricity when fueled with coal.","permalink":"/Pilot.lua-Luau-LSP/objects/BurnerGenerator"},{"id":"objects/ChemicalSynthiser","title":"ChemicalSynthiser","description":"Synthesizes and mixes chemical compounds. Consumes matter out of attached bins in order to fuel the material synthesis.","permalink":"/Pilot.lua-Luau-LSP/objects/ChemicalSynthiser"},{"id":"objects/CloningBay","title":"CloningBay","description":"Allows you to respawn at it from a remote location.","permalink":"/Pilot.lua-Luau-LSP/objects/CloningBay"},{"id":"objects/CombustionTurbine","title":"CombustionTurbine","description":"Creates electricity when fueled by gasoline.","permalink":"/Pilot.lua-Luau-LSP/objects/CombustionTurbine"},{"id":"objects/ConveyorBelt","title":"ConveyorBelt","description":"Moves objects ontop of it towards the front of the conveyor belt. Only moves when powered and anchored or attached to the ground.","permalink":"/Pilot.lua-Luau-LSP/objects/ConveyorBelt"},{"id":"objects/Cooler","title":"Cooler","description":"Cools down the heat around a space when supplied with power.","permalink":"/Pilot.lua-Luau-LSP/objects/Cooler"},{"id":"objects/DarkConverter","title":"DarkConverter","description":"Converts attached dark matter bins into energy. 1 unit of dark matter is equal to 1000 watts of power. However, this generates a ton of heat in the process, nearly up to 200 degrees when activated. This means you will need about 10 coolers to avoid combustion.","permalink":"/Pilot.lua-Luau-LSP/objects/DarkConverter"},{"id":"objects/DarkReactor","title":"DarkReactor","description":"Generates Dark Matter when powered and near a black hole.","permalink":"/Pilot.lua-Luau-LSP/objects/DarkReactor"},{"id":"objects/DevGenerator","title":"DevGenerator","description":"A debug item meant for developers.","permalink":"/Pilot.lua-Luau-LSP/objects/DevGenerator"},{"id":"objects/Diode","title":"Diode","description":"Acts as a wire/chute/pipe/etc, but only works one way, through the diode\'s input and output faces as indicated by the arrow.","permalink":"/Pilot.lua-Luau-LSP/objects/Diode"},{"id":"objects/ElectricFence","title":"ElectricFence","description":"A special version of the fence which damages upon contact as long as it is powered. Conducts electricity like a wire.","permalink":"/Pilot.lua-Luau-LSP/objects/ElectricFence"},{"id":"objects/Electromagnet","title":"Electromagnet","description":"A powerful magnet.","permalink":"/Pilot.lua-Luau-LSP/objects/Electromagnet"},{"id":"objects/Extractor","title":"Extractor","description":"Harvests or mines materials from the world. It can extract things like grass, snow, wood, ores, etc depending on what terrain it is attached to.","permalink":"/Pilot.lua-Luau-LSP/objects/Extractor"},{"id":"objects/FloatDevice","title":"FloatDevice","description":"Produces a force which counteracts gravity and keeps the device floating. The device will additionally resist upwards and downwards vertical motion.","permalink":"/Pilot.lua-Luau-LSP/objects/FloatDevice"},{"id":"objects/FluidProjector","title":"FluidProjector","description":"A device which projects a field of gas or liquid in front of it which you can swim in.","permalink":"/Pilot.lua-Luau-LSP/objects/FluidProjector"},{"id":"objects/Freezer","title":"Freezer","description":"Turns liquid Water into solid Ice, expelling heat energy in the process. Requires some power.","permalink":"/Pilot.lua-Luau-LSP/objects/Freezer"},{"id":"objects/Generator","title":"Generator","description":"Creates energy from rotation.","permalink":"/Pilot.lua-Luau-LSP/objects/Generator"},{"id":"objects/GravityGenerator","title":"GravityGenerator","description":"Generates an artificial gravity field when powered on. The gravity field only affects players, not individual parts. The amount of gravity can also be configureed, but the more gravity the higher amount of power needed. Only works in space, not inside planets.","permalink":"/Pilot.lua-Luau-LSP/objects/GravityGenerator"},{"id":"objects/Gyro","title":"Gyro","description":"Stabilizes vehicles and structures by pointing upwards. Useful for mechs or orientating structures to the correct rotation. Has a maximum range of 75000 studss. The gyro can also be configured to seek objects and players.","permalink":"/Pilot.lua-Luau-LSP/objects/Gyro"},{"id":"objects/Heater","title":"Heater","description":"Heats the air to 60 + volume / 16 * 10\xb0F.","permalink":"/Pilot.lua-Luau-LSP/objects/Heater"},{"id":"objects/HeatPump","title":"HeatPump","description":"Pumps Heat between two points. Pumps a maximum of 4 MW of heat energy.","permalink":"/Pilot.lua-Luau-LSP/objects/HeatPump"},{"id":"objects/Heatshield","title":"Heatshield","description":"Generates a 300 stud radius area that protects all players and only players within the vicinity from temperature damage.","permalink":"/Pilot.lua-Luau-LSP/objects/Heatshield"},{"id":"objects/Hologram","title":"Hologram","description":"Using our brand new Multi-Dimensional Holographic Projection Technology\u2122 you are able to create a stationary clone with only the ID of the user provided!.","permalink":"/Pilot.lua-Luau-LSP/objects/Hologram"},{"id":"objects/Hydroponic","title":"Hydroponic","description":"Grows grass and wood from water, turning attached water bins into either wood, sticks or grass. Incredibly useful for space bases or bases in areas devoid of life.","permalink":"/Pilot.lua-Luau-LSP/objects/Hydroponic"},{"id":"objects/HyperspaceRadar","title":"HyperspaceRadar","description":"A device that images areas of hyperspace, allowing one to view hyperspace disturbances and track where HyperDrives have warped.","permalink":"/Pilot.lua-Luau-LSP/objects/HyperspaceRadar"},{"id":"objects/IonRocket","title":"IonRocket","description":"A simple, fast propulsion device which consumes power to produce thrust. Moves in the direction of the arrow.","permalink":"/Pilot.lua-Luau-LSP/objects/IonRocket"},{"id":"objects/Kiln","title":"Kiln","description":"Turns attached sand bins into glass.","permalink":"/Pilot.lua-Luau-LSP/objects/Kiln"},{"id":"objects/Laser","title":"Laser","description":"Fires a concentraded beam of energy when powered, which can be used to damage and set objects on fire.","permalink":"/Pilot.lua-Luau-LSP/objects/Laser"},{"id":"objects/Light","title":"Light","description":"Emits light when powered with electricity. Can be colored in different ways, changing the light color.","permalink":"/Pilot.lua-Luau-LSP/objects/Light"},{"id":"objects/LightBridge","title":"LightBridge","description":"Fires a beam of solid light that can be walked on.","permalink":"/Pilot.lua-Luau-LSP/objects/LightBridge"},{"id":"objects/LightTube","title":"LightTube","description":"Emits light when powered with electricity. Can be colored in different ways, changing the light color.","permalink":"/Pilot.lua-Luau-LSP/objects/LightTube"},{"id":"objects/Melter","title":"Melter","description":"Melts Ice into liquid Water by consuming Power.","permalink":"/Pilot.lua-Luau-LSP/objects/Melter"},{"id":"objects/MiningLaser","title":"MiningLaser","description":"Fires a beam at resource deposits that will mine them just like an Extractor can, allowing for mining while mobile.","permalink":"/Pilot.lua-Luau-LSP/objects/MiningLaser"},{"id":"objects/Modem","title":"Modem","description":"A part that allows you to send messages cross-region and make HTTP requests to the web.","permalink":"/Pilot.lua-Luau-LSP/objects/Modem"},{"id":"objects/Motor","title":"Motor","description":"Spins objects attached to the hinge at the front when powered.","permalink":"/Pilot.lua-Luau-LSP/objects/Motor"},{"id":"objects/Obelisk","title":"Obelisk","description":"An object designed to attract aliens to the region. Emits an ominous noise when powered.","permalink":"/Pilot.lua-Luau-LSP/objects/Obelisk"},{"id":"objects/ObjectDetector","title":"ObjectDetector","description":"Casts a ray on the face with the hole on it, returning data of the object the ray hits.","permalink":"/Pilot.lua-Luau-LSP/objects/ObjectDetector"},{"id":"objects/Pulverizer","title":"Pulverizer","description":"Pulverizes resources into powdered forms. Power cost: 3/s.","permalink":"/Pilot.lua-Luau-LSP/objects/Pulverizer"},{"id":"objects/Pump","title":"Pump","description":"Pumps liquid from the environment into attached Tanks. For example, a pump located in the ocean will pump water when powered.","permalink":"/Pilot.lua-Luau-LSP/objects/Pump"},{"id":"objects/Railgun","title":"Railgun","description":"Fires a piercing Rail at high speeds. A long range weapon. Requires Rails and electricity for ammo. The damage increases for every 10 studs of length.","permalink":"/Pilot.lua-Luau-LSP/objects/Railgun"},{"id":"objects/Refinery","title":"Refinery","description":"Turns oil into Petroleum and Gasoline.","permalink":"/Pilot.lua-Luau-LSP/objects/Refinery"},{"id":"objects/RegionCloaker","title":"RegionCloaker","description":"Hides a certain region from players, making the coordinates not appear on their screen.","permalink":"/Pilot.lua-Luau-LSP/objects/RegionCloaker"},{"id":"objects/RepairLaser","title":"RepairLaser","description":"Fires a beam that repairs objects. Repairs 1 HP/s.","permalink":"/Pilot.lua-Luau-LSP/objects/RepairLaser"},{"id":"objects/RepairPlate","title":"RepairPlate","description":"EXPERIMENTAL - While at least 90% charged (27 power), distributes repaired health between itself and damaged parts attached to its top surface.","permalink":"/Pilot.lua-Luau-LSP/objects/RepairPlate"},{"id":"objects/Router","title":"Router","description":"A wireless transmitter that can transmit an ethernet connection.","permalink":"/Pilot.lua-Luau-LSP/objects/Router"},{"id":"objects/RTG","title":"RTG","description":"Creates electricity from decaying radioactive elements.","permalink":"/Pilot.lua-Luau-LSP/objects/RTG"},{"id":"objects/Scanner","title":"Scanner","description":"An end-game part which can remotely retrieve Microcontroller references to parts, providing information and control. Can also triangulate the positions of enemy parts given enough well placed scanners.","permalink":"/Pilot.lua-Luau-LSP/objects/Scanner"},{"id":"objects/Scrapper","title":"Scrapper","description":"Scraps unlocked solid items into their crafting components (with some loss) on contact when powered, else destroys them if unpowered. Will send locked single raw parts such as Iron or AlienCore into connected bins.","permalink":"/Pilot.lua-Luau-LSP/objects/Scrapper"},{"id":"objects/Screen","title":"Screen","description":"Allows for the programmatic creation of GUI elements.","permalink":"/Pilot.lua-Luau-LSP/objects/Screen"},{"id":"objects/Servo","title":"Servo","description":"Spins objects attached to the hinge at the front when powered, to set angles.","permalink":"/Pilot.lua-Luau-LSP/objects/Servo"},{"id":"objects/SolarPanel","title":"SolarPanel","description":"Generates electricity using solar energy from a local star.","permalink":"/Pilot.lua-Luau-LSP/objects/SolarPanel"},{"id":"objects/SolarScoop","title":"SolarScoop","description":"Extracts materials from a star when powered and pointed at a star.","permalink":"/Pilot.lua-Luau-LSP/objects/SolarScoop"},{"id":"objects/Solenoid","title":"Solenoid","description":"Controls the switch state of any switches attached to its output face based on whether or not it has power in the configured range.","permalink":"/Pilot.lua-Luau-LSP/objects/Solenoid"},{"id":"objects/Sorter","title":"Sorter","description":"Moves a type of resource through it, depending on the input and output faces as indicated by the arrow. Behaves just like the old Diode part when set to insert 100 Power.","permalink":"/Pilot.lua-Luau-LSP/objects/Sorter"},{"id":"objects/Speaker","title":"Speaker","description":"Plays audio of length up to 5 seconds, unless it is powered in which case it can play a full audio.","permalink":"/Pilot.lua-Luau-LSP/objects/Speaker"},{"id":"objects/Spotlight","title":"Spotlight","description":"Emits light in a cone when powered with electricity. Color emition can be changed by coloring it.","permalink":"/Pilot.lua-Luau-LSP/objects/Spotlight"},{"id":"objects/StarMap","title":"StarMap","description":"Shows your current location in the universe and other nearby stars and celestial bodies.","permalink":"/Pilot.lua-Luau-LSP/objects/StarMap"},{"id":"objects/StasisField","title":"StasisField","description":"Creates a 500 stud radius field that prevents any parts or objects around it from being dragged.","permalink":"/Pilot.lua-Luau-LSP/objects/StasisField"},{"id":"objects/SteamTurbine","title":"SteamTurbine","description":"Produces power from steam at a base rate of 100 power each. Improves up to 250 per steam if consecutively ran at max speed. All bonuses are capped to the real consumption rate, so more steam equals better efficiency, but faster consumption rates. It may consume +0.5/s^2 steam, up to a maximum rate of 10 steam per second (for a total of 2500 power per second). Has a 10% chance to recover water for every steam consumed, improving up to 20%. Maximum efficiency can be reached in no less than 18 seconds if fed an optimal amount of steam.","permalink":"/Pilot.lua-Luau-LSP/objects/SteamTurbine"},{"id":"objects/Telescope","title":"Telescope","description":"A device that allows you to see and query information about other regions and planets in space while powered.","permalink":"/Pilot.lua-Luau-LSP/objects/Telescope"},{"id":"objects/TestStarMap","title":"TestStarMap","description":"A developer version of the starmap.","permalink":"/Pilot.lua-Luau-LSP/objects/TestStarMap"},{"id":"objects/Thruster","title":"Thruster","description":"A high powered propulsion device. The larger the thruster, the faster it can go, up to 500s/s, but it will consume more power.","permalink":"/Pilot.lua-Luau-LSP/objects/Thruster"},{"id":"objects/TouchScreen","title":"TouchScreen","description":"A Screen, but can handle player mouse input.","permalink":"/Pilot.lua-Luau-LSP/objects/TouchScreen"},{"id":"objects/TractorBeam","title":"TractorBeam","description":"Fires a beam that exerts force on the object it hits. More effective in space due to low gravity, but still decently strong when affected by gravity. Force is affected by size and configuration.","permalink":"/Pilot.lua-Luau-LSP/objects/TractorBeam"},{"id":"objects/Transistor","title":"Transistor","description":"Carries trigger signals in the direction of the arrow if any power source is attached. Can be inverted by clicking or configuring.","permalink":"/Pilot.lua-Luau-LSP/objects/Transistor"},{"id":"objects/WaterCooler","title":"WaterCooler","description":"Removes -100 heat from the surrounding area, when supplied with power. Performs the same amount of cooling that five coolers would, give or take.","permalink":"/Pilot.lua-Luau-LSP/objects/WaterCooler"},{"id":"objects/Wire","title":"Wire","description":"Allows electrical objects to interact with each other when connected by wires. For example, attaching a wire between a powercell and a light will allow electricity to move through the wire, allowing the light to function causing a source of light to be created.","permalink":"/Pilot.lua-Luau-LSP/objects/Wire"},{"id":"objects/ZapWire","title":"ZapWire","description":"Electrocutes players when touched. Can be used to set flammable objects on fire.","permalink":"/Pilot.lua-Luau-LSP/objects/ZapWire"}],"unlisted":false}}')}}]);